Louise has been teaching weaving for 20 year - with a maternity year when I covered her teaching. This #flashback photo is from 2006 of how the weaving workshop looked back then.  Whilst, I was teaching, Louise and I realised that we had found something that worked really well for both of us and we knew it had the potential to be something bigger.
