The inspiration for @the_loom_shed came from wanting more space, wanting to teach more things textiles related, having a space that was genuinely ours and to be able to host events from other tutors with textiles at the heart of them, be it teaching,  book launches, talks, dye days or exhibitions.
â €â €â €â €â €â €â €â €â €
What we really want to do is have a space where you can come to be inspired about textiles, or be a visiting tutor, and inspire others around you (or both)
in our lovely Devon Shed.
